import { BrowserRouter, Route, Routes, useNavigate } from 'react-router-dom'
import { Footer } from '../Footer'
import NotFound from '../NotFound'
import  CompanyAddCoupon  from './CompanyAddCoupon'
import CompanyDeleteCoupon from './CompanyDeleteCoupon'
import CompanyGetAllCoupons from './CompanyGetAllCoupons'
import CompanyGetCouponsByCategory from './CompanyGetCouponsByCategory'
import CompanyGetCouponsByMaxPrice from './CompanyGetCouponsByMaxPrice'
import CompanyGetDetails from './CompanyGetDetails'
import CompanyUpdateCoupon from './CompanyUpdateCoupon'
import { NavBarCompany } from './NavBarCompany'

interface Props {
  token?: string,
  id?: number; // make id prop optional
}

export const HomeCompany = (props: Props) => {
  const navigate = useNavigate();
  const handleGoBack = () => {
    navigate(-1);
  };
  const handleGoToHomePage = () => {
    navigate('/');
  };
  return (
    <div className="HomeAdmin">
      <button onClick={handleGoBack}>Go back</button>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<NavBarCompany />} />
          <Route path='/addCoupon' element={<CompanyAddCoupon token={props.token} id={props.id}/>} />
          <Route path='/updateCoupon' element={<CompanyUpdateCoupon token={props.token} id={props.id}/>} />
          <Route path='/getCoupons/all' element={<CompanyGetAllCoupons token={props.token} id={props.id}/>} />
          <Route path='/deleteCoupon' element={<CompanyDeleteCoupon token={props.token} companyId={props.id}/>} />
          <Route path='/getCoupons/category' element={<CompanyGetCouponsByCategory token={props.token} id={props.id}/>} />
          <Route path='/getCoupons/maxToPay' element={<CompanyGetCouponsByMaxPrice token={props.token} id={props.id} />} />
          <Route path='/getDetails' element={<CompanyGetDetails token={props.token} id={props.id}/>} />
          <Route path='/*' element={<button onClick={handleGoToHomePage}>Go to home page</button>} />
        </Routes> 
      </BrowserRouter>
      <Footer/>
    </div>
  )
}
